        <Link to="/" className="text-lg font-bold"></Link>
        <div className="space-x-4">
          <Link to="/studentRegister" className="hover:bg-gray-700 px-3 py-2 rounded">Take Test</Link>
          <Link to="/create-test" className="hover:bg-gray-700 px-3 py-2 rounded">Scores</Link>
          {/* <Link to="/validate-test" className="hover:bg-gray-700 px-3 py-2 rounded">Test Reports</Link> */}
